import { Morph } from "lively.morphic";
import { TreeData, Tree } from "lively.morphic/components/tree.js";
import { pt, Color } from "lively.graphics";
import { connect } from "lively.bindings";
import { InteractiveMorphSelector } from "lively.morphic/halo/morph.js";


// -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

function morphToTreeNode(morph, submorphFilter = m => true) {
  return {
    morph,
    isCollapsed: true, 
    isSelected: false,
    _childMap: new WeakMap(),
    get children() {
      return this.morph.submorphs.filter(submorphFilter).map(m => {
        let node = this._childMap.get(m);
        if (!node) {
          node = morphToTreeNode(m, submorphFilter);
          this._childMap.set(m, node);
        }
        return node;
      });;
    }
  }
}

class MorphSceneTreeData extends TreeData {
  static empty() {
    return new this({children: [], isCollapsed: true})
  }
  display(node) { return node.morph ? node.morph.toString() : "root" }
  isCollapsed(node) { return node.isCollapsed; }
  collapse(node, bool) { node.isCollapsed = bool; }
  getChildren(node) { return node.children; }
  isLeaf(node) { return node.morph ? node.morph.submorphs.length === 0 : false; }
}

export default class MorphSceneInspector extends Morph {

  static get properties() {

    return {

      targetMorph: {
        after: ["submorphs"],
        set(m) {
        this.setProperty("targetMorph", m);
          let tree = this.getSubmorphNamed("tree");
          tree.treeData = m ? new MorphSceneTreeData({
            children: [morphToTreeNode(m)],
            isCollapsed: false
          }) : MorphSceneTreeData.empty();
        }
      }

    }
  }

  reset() {
    // this.targetMorph = null
    // this.targetMorph = that
  }

  build() {
    this.submorphs = [
      new Tree({
        extent: pt(300,270), fill: Color.white, border: {color: Color.gray, width: 1},
        name: "tree",
        treeData: MorphSceneTreeData.empty()
      }),
      {
        type: "button",
        label: "inspect",
        name: "inspect button",
        bottomLeft: pt(10, 300 - 10)
      },
      {
        type: "button",
        label: "edit",
        name: "edit button",
        bottomLeft: pt(110, 300 - 10)
      }
    ];

    let [inspectBtn, editBtn, tree] = this.submorphs;
    connect(tree, 'selection',  this, 'showMorph');
    connect(inspectBtn, 'fire', this, 'inspectMorph');
    connect(editBtn, 'fire',    this, 'editMorph');

    let chooseTargetButton = this.get("choose target button")
    connect(chooseTargetButton, 'fire',    this, 'chooseTarget');
  }

  get selectedMorph() { return this.getSubmorphNamed("tree").selection.morph; }

  editMorph() { this.selectedMorph.edit(); }
  inspectMorph() { this.selectedMorph.inspect(); }
  showMorph() { this.selectedMorph.show(); }

  async chooseTarget() {
    this.targetMorph = await InteractiveMorphSelector.selectMorph(this.world(), this);
  }
}

