import L2LClient from "lively.2lively/client.js";
import { loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";

export default class User_Widget extends Morph {

  static get properties() {
    return {
      registeredUsers: {defaultValue: []}
    }
  }

  async sessionDidTimeOut(user) {
    let valid = (await this.sendRequest('validate', {token: user.token}))
    return (!L2LClient.default().isRegistered() && user.token) ||
           (valid && valid.type != 'success');
  }

  async checkOnlineStatus() {
    let user = this.get('Discussion').user;
    if (!user) return;
    if (await this.sessionDidTimeOut(user)) {
      this.logoutUser(user);
    }
  }

  logoutUser(user) {
    L2LClient.default().register()
    this.get('Discussion').showWelcomeScreen();
  }

  enterLogin() {
    if (this.widgetMode == 'login') return;
    this.widgetMode = 'login';
    this.showMorphs('login title', 'new user button');
    this.get('login title').topCenter = this.innerBounds().insetBy(20).topCenter();
    this.hideMorphs('create user title', 'back button');
    this.get('Login User Controls').animate({
       topCenter: this.get('login title').bottomCenter,
       opacity: 1,
       duration: 300
    })
    this.get('Create User Controls').animate({
       topLeft: this.innerBounds().topRight().addXY(0,50),
       opacity: 0,
       duration: 300
    })
    this.animate({
       height: 400,
       duration: 300
    });
    this.get('Discussion').relayout(300);
  }

  async clearLogin() {
    this.get('user avatar').showUser('');
    this.get('user name').clear();
    this.get('login password input').clear()
  }

  get __only_serialize__() {
    return [...super.__only_serialize__, 'haloShadow'];
  }

  enterRegister() {
    if (this.widgetMode == 'register') return;
    this.widgetMode = 'register';
    this.showMorphs('back button', 'create user title');
    this.get('create user title').topCenter = this.innerBounds().insetBy(20).topCenter();
    this.hideMorphs('login title', 'new user button');
    this.get('Create User Controls').animate({
       topCenter: this.get('create user title').bottomCenter,
       opacity: 1,
       duration: 300
    })
    this.get('Login User Controls').animate({
       topRight: this.innerBounds().topLeft().addXY(0,50),
       opacity: 0,
       duration: 300
    })
    this.animate({
       height: 470,
       duration: 300
    });
    this.get('Discussion').relayout(300);
  }

  async createUser() {
    const userNameField = this.get('user name input 2'),
          emailField = this.get('user email'),
          pwField = this.get('create password input'),
          email = emailField.textString,
          userName = userNameField.textString,
          pw1 = pwField.input,
          avatar = this.get('AvatarEditor').getAvatarInfo();
    let user = await createUser({
        name: userName,
        email,
        password: pw1,
        avatar
      });
    emailField.clear();
    userNameField.clear();
    pwField.clear();
    this.get('retype password input').clear();
    this.get('AvatarEditor').cleanup();
    this.enterLogin();
  }

  async sendRequest(name, payload) {
    return (await L2LClient.default().sendToAndWait(L2LClient.default().trackerId, name, payload)).data
  }

  async retrieveUsers() {
     this.allUsers = (await this.sendRequest('listUsers')).users;
  }

  async retrieveTopics() {
    let {topics} = await this.sendRequest('listTopics', {});
    return topics;
  }

  async loginUser() {
    var user;
    if (user = await this.authenticateUser(this.get('user name').textString)) {
      this.get('Discussion').hideLogin();
      this.get('Discussion').hideWelcomeScreen();
      this.get('Discussion').user = user;
      this.get('Discussion').renderTopics(await this.retrieveTopics());
      await L2LClient.default().whenRegistered(2000);
      this.startStepping(5000, 'checkOnlineStatus');
    } else {
      this.get('login password input').toggleWarning(true);
    }
  }

  async authenticateUser(email) {
    var authUser = await getUser({email}),
        user = {
         ...authUser,
         username: 'Robin Schreiber',
         password: this.get('login password input').input};
    user.token = (await authenticateUser(user)).token;
    user.avatar = deserialize(user.avatar);
    if (!user.token.error) {
      return user
    } else {
      return false;
    }
  }

  showMorphs(...morphs) {
    for (var b of morphs) {
      this.get(b).animate({opacity: 1, visible: true, duration: 300});
    }
  }

  hideMorphs(...morphs) {
    for (var b of morphs) {
      this.get(b).animate({opacity: 0, visible: false, duration: 300});
    }
  }
}

